column8:
シフトレバーのスポーツシフト、パドルシフトと連動してアップダウン時に高輝度ホワイトLEDにより表現し、スポーツ走行をより楽しむ為のシフトインジケーターです。■キーOFF時 スモーク色状態で表示が見えないブラックフェイス仕様。■キーON時 キースイッチをONにすると、スタートデモンストレーション後に赤色の『708』表示が浮かび上がります！■スポーツシフト（マニュアルシフト）時 シフトレバーをスポーツシフト（マニュアルシフト）側に倒すと青色『Ｍ』が点滅を始めます。<br><br>※一部車種はＭ表示にアダプターが必要です。また、Ｍ表示が出来ない車種もあります。適合表にてご確認下さい。オプションの708MPアダプターを使用した場合、設定回転数により『Ｍ』を点滅させることが可能です。※この場合回転信号線への配線が必要です。回転信号線の取り出せない車種には708MPアダプターは取付出来ません。■シフトアップ時 シフトレバーを『＋（UP）』ポジションに倒すと（もしくはパドルシフトの『＋』にすると）高輝度ホワイトLEDが1回点滅します。<br><br>■シフトダウン時シフトレバーを『－（DOWN）』ポジションに倒すと（もしくはパドルシフトの『－』にすると）高輝度ホワイトLEDが3回点滅します。注意）商品到着後の色の変更は出来ませんのでご了承ください。※本体の色が選べます！（黒・赤・青・銀・ガンメタ）の中よりご指定ください。※ご指定がない場合、黒にてお送りいたします。注意）発送後の色の変更は出来ませんのでご了承ください。<br><br>対応車種：GS430 UZS190 3UZ-FSE 05.07～<br><br><br><br>メーター | メーターその他<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


